                    <div class="tab-pane  "  id = "tab5">


                        <html><head><meta charset="utf-8"></head><body>
<div><strong>ОПИСАНИЕ</strong></div>
<div>Проверенная формула Lactol Kitty Milk была улучшена и обогащена докозагексаеновой кислотой, которая естественным образом содержится в материнском молоке кошек, необходима для развития мозга, памяти и способности к обучению. Lactol Kitty Milk легко усваивается и содержит сбалансированный спектр жиров, необходимых витаминов, минералов и микроэлементов, а также богато аминокислотами, в том числе жизненно необходимым таурином, для самого лучшего начала жизни. Lactol Kitty Milk рекомендовано для: oсиротевших котят и котят, которые мало едят. Смесь может быть использована как полноценное питание при переходе от материнского. Хранение: хранить при комнатной температуре, в плотно закрытой оригинальной упаковке, в сухом прохладном и защищенном от света месте, недоступном для детей. После вскрытия упаковки рекомендуется использовать сухую молочную смесь в течение 3 месяцев. Только для животных. Не содержит ГМО.</div>
<div>&nbsp;</div>
<div><strong>СОСТАВ</strong></div>
<div>Молоко и молочные продукты, жиры, минералы. Анализ: протеин 32%, клетчатка 0%, жиры 24%, зола 7%, влага 3,5%, кальций 0,8%, фосфор 0,7%, натрий 0,5%, магний 0,16%, калий 1,5%, докозагексаеновая кислота (DHA) 0,1%, лактоза 34%, омега-3 жирные кислоты 0,1%. Энергетическая ценность: 5230 кДж/л. Добавки на 1 кг: витамины A 25 000 ME, B1 5 мг, B2 3 мг, B6 3 мг, B12 60 мкг, C 100 мг, D3 2000 ME, E 210 ME, биотин 50 мкг, K3 3 мг, таурин 3000 мг, пантотеновая кислота 10 мг, DL-метионин 80 мг, Fe (моногидрат сульфата железа) 80 мг, I (3b201) 0,25 мг, Mn (моногидрат сульфата марганца) 30 мг, Se (селенит натрия) 0,2 мг, Zn (3b605) 50 мг, антиоксиданты.</div>
<div>&nbsp;</div>
<div><strong>ПОРЯДОК ПРИМЕНЕНИЯ</strong></div>
<div>Смешайте Lactol Kitty Milk c горячей (но не кипящей) водой и помешивайте до полного растворения. Позвольте смеси остыть до температуры 38&deg; C. Настоятельно рекомендуется использование специальных приспособлений, например, набора для кормления Beaphar Feeding Set или шприцев для вскармливания Beaphar, все предметы должны быть всегда стерильны, особенно при использовании у молодых животных. Готовая смесь Lactol Kitty Milk может храниться в холодильнике не более 24 часов. Для повторного использования подогрейте смесь (рекомендуется подогревать смесь на водяной бане).</div>
</body></html>
                    </div>

                
            
                


                

                    <div class="tab-pane  "  id = "tab7">


                        <html><head><meta charset="utf-8"></head><body>
<p>7 мерных ложек без горочки (в одной ложке 4,5 г) на каждые 100 мл теплой воды. Определение точной суточной нормы невозможно по причине различий в возрасте, размере и породе. Наиболее эффективным является кормление по требованию. Тем не менее мы прилагаем свои рекомендации по дозировке, которые находятся в инструкции. Каждого котенка следует регулярно взвешивать для отслеживания ежедневной прибавки в весе.</p>
</body></html>
